import st from '../modules/footer.module.scss';

function Footer() {
    return <>
        <div className={st.cptFooter}>
            <div className={st.inner}>
                <div className={st.left}>

                </div>
                <div className={st.right}>
                    
                </div>
            </div>
        </div>
    </>;
}

export default Footer;
